import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Autoplay, Pagination, Navigation } from 'swiper/modules';
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import { Fullscreen } from 'lucide-react';

const images = [
    'data:image/jpeg;base64,',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSA3yX0qnwK-e3wpjz27siDc7EbRzfB8Yex92ru3qWAFR7-K-HomK3uP3ZAOkc4UPBCws8&usqp=CAU',
    'https://www.bhaskarhindi.com/h-upload/2023/11/09/853652-vanrai-bandhare201808125756.webp',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ_flE218KFCVxfKnY-gMe4dQzzxdhiEH8NWuwPUDB5OPWS1jeqQRebbd8i3yKo8FTvLIA&usqp=CAU',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS-8CsJZJMLX5je68bYrXCOoGibSaE3VBq1MQ&s',
];

const OurDevraiSlider = () => {
    return (
        <div className="w-full bg-white">
            <Swiper
                spaceBetween={30}
                centeredSlides={true}
                autoplay={{
                    delay: 3000,
                    disableOnInteraction: false,
                }}
                pagination={{
                    clickable: true,
                }}
                navigation={true}
                modules={[Autoplay, Pagination, Navigation]}
                className="overflow-hidden"

            >
                {images.map((img, index) => (
                    <SwiperSlide key={index} >
                        <img
                            src={img}
                            alt={`Devrai ${index + 1}`}
                            className="
                  w-full
                  h-[20rem]       
                  sm:h-[24rem]     
                  md:h-[28rem]     
                  lg:h-[32rem]     
                  xl:h-[36rem]     
                  2xl:h-[40rem]   
                "

                        />
                    </SwiperSlide>
                ))}
            </Swiper>
        </div>
    );
};

export default OurDevraiSlider;
